import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { withStyles, Grid, Typography, Container, Breadcrumbs, Link, Tabs, Tab } from '@material-ui/core';
import { withTranslation } from 'react-i18next';
import styles from './style';
import Header from '../../components/header';
import { bannerFundoCrypto } from '../../components/icons';
import Footer from '../../components/footer';
import ExchangeInput from '../../components/exchangeInput';
import binanceService from '../../services/binance.service';

class CambioCripto extends Component {
  constructor(props) {
    super(props);
    this.state = {
      inputValue1: '',
      inputValue2: '',
      select1: 'BTC',
      select2: 'EUR',
      costPercentage: 0.05,
      operationCosts: 0.0,
      convertedValue: 0.0,
      cryptos: [],
      exchangeRate: '',
      tabValue: 0,
    };
  }

  render() {
    const { classes, t } = this.props;

    return (
      <>
        <Header />

        <Grid container className={classes.banner1}>
          <Container>
            <Grid className={classes.banner}></Grid>
          </Container>
        </Grid>
        <Footer />
      </>
    );
  }
}

export default withRouter(withStyles(styles)(CambioCripto));
